import React,{Component} from 'react';
import { Modal,Effect} from 'react-dynamic-modal';

import ListItem from "../ListComponent/ListItem/ListItem";

class MyModal extends Component{
   render(){
      const { params,onRequestClose } = this.props;

      return (
         <Modal
            onRequestClose={onRequestClose}
            effect={Effect.SlideFromBottom}>

               {params.votings !== undefined && params.votings !== null ? params.votings.map((item,index)=>{
                return <p key={index} > <ListItem key={item[0] + index} >{ item[0] + "  " +item[1] } </ListItem></p>
            }) :  ''}
         </Modal>
      );
   }
}

export default MyModal;
